script: |
  super -f text -I q9466.spq | sort > q9466.out

inputs:
  - name: q9466.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT + - ( - - 43 ) IN ( + col0 + + - col0, col2 - 14 + + - 65 * ( - - CAST ( - + col0 AS INTEGER ) ), + col2 + - + col1 * - 16 / col0 * - col0, + + 62 - + - 66, - col1 * - + col1 + CAST ( - CAST ( - col2 AS INTEGER ) AS INTEGER ) );
  - name: tab2

outputs:
  - name: q9466.out
    data: |
      46	51	23
      64	77	40
      75	67	58
